O Extrator da Plataforma Lattes tem o intuito de auxiliar as instituições a integrar os dados da Plataforma Lattes aos seus sistemas de informação, gerar indicadores internos de produção científica e tecnológica, realizar estudos através da aplicação de ferramentas de mineração de dados e apoiar a implementação de políticas de gestão, sendo vedada sua utilização para fins comerciais.  O CNPq permitirá a extração de dados por meio do sistema web, de sua propriedade, denominado Extrator Lattes que permite a extração dos dados públicos da Base de Currículos Lattes e do Diretório dos Grupos de Pesquisa. Poderão solicitar acesso ao Extrator Lattes:

a)	Instituição Científica, Tecnológica e de Inovação (ICT);
b)	Instituição de ensino superior;
c)	agências de fomento à pesquisa - da União, dos Estados, do Distrito Federal e dos Municípios; e
d)	Órgãos e as entidades da administração pública federal direta e indireta e as demais entidades controladas direta ou indiretamente pela União, conforme previsto no Decreto nº 8.789/2016;

A pessoa física poderá ter acesso ao Extrator Lattes a partir e sob responsabilidade da instituição a qual esteja vinculada, devendo efetuar diretamente com esta os trâmites e procedimentos técnicos de extração.

O DNPM é órgão anuente na exportação de coleções e espécimes para coleções “de interesse paleontológico” (classificado na NCM 9705.00.00, com o destaque 04)  junto ao Sistema Integrado de Comércio Exterior - SISCOMEX do Departamento de Operações de Comércio Exterior-DECEX/Ministério do Desenvolvimento, Indústria e Comércio Exterior – MDIC. 
A solicitação ao DNPM de anuência no envio de fósseis ao exterior (exportação) deve ser encaminhada, por meio de Oficio/carta,  com as seguintes informações: 
a) identificação do interessado e sua instituição cientifica;
b) relação do material fóssil (informar o nº tombo na coleção da instituição, se houver);
c) local (instituição, laboratório, etc.) de destino no exterior;
d) finalidade: I) exposição/evento científico, II)estudo científico: tipo e caracterização do estudo no exterior (se destrutivo ou não) e III) outros (descrever);
e) justificativa e projeto de pesquisa relacionado (anexar);
f) período de permanência no exterior: saída temporária (período/prazo) ou permanente;
g) meio de saída (aeroporto, porto e correio).

Os espécimes fósseis são bens da União, nos termos do art. 20, I e X, da Constituição Federal, combinado com o art. 1º do Decreto-Lei nº 4.146/42.
Os fósseis que estão sob a guarda do DNPM serão destinados às entidades de ensino e/ou pesquisa públicas por meio de Termo de Cessão de uso de espécimes fósseis efetuada pelo DNPM em favor da instituição.
O representante legal da instituição encaminha um Ofício/Carta ao DNPM em que solicita material fóssil. Nesse Ofício/carta deverão constar:
- a justificativa de solicitação dos fósseis;
- nome da instituição de ensino e CNPJ; 
- endereço completo (com CEP) da instituição; 
- nome completo (por extenso) do Diretor/Reitor e seu RG,  
- telefone e-mail de contato.

Os espécimes fósseis são bens da União, nos termos do art. 20, I e X, da Constituição Federal, combinado com o art. 1º do Decreto-Lei nº 4.146/42.
Os fósseis que estão sob a guarda do DNPM serão destinados às entidades de ensino e/ou pesquisa privadas por meio de Termo de Permissão de uso de espécimes fósseis efetuada pelo DNPM em favor da instituição.
O representante legal da instituição encaminha um Ofício/Carta ao DNPM em que solicita material fóssil. Nesse Ofício/carta
deverão constar:
- a justificativa de solicitação dos fósseis;
- nome da instituição de ensino e CNPJ;
- endereço completo (com CEP) da instituição;
- nome completo (por extenso) do Diretor/Reitor e seu RG;
- telefone e-mail de contato.

Para adquirir uma arma de fogo de uso permitido, por meio de transferência oriunda de outro proprietário, o adquirente deve dirigir-se a uma unidade da Polícia Federal munido de requerimento preenchido, além de apresentar os seguintes documentos e condições:
(a) documento de identificação e CPF;
(b) ter idade mínima de 25 anos, exceto para os cargos definidos no artigo 28 da Lei 10.826/03;
(c) declaração escrita da efetiva necessidade, expondo fatos e circunstâncias que justifiquem o pedido;
(d) comprovação de idoneidade, com a apresentação de certidões negativas de antecedentes criminais fornecidas pela Justiça Federal, Estadual (incluindo Juizados Especiais Criminais), Militar e Eleitoral e de não estar respondendo a inquérito policial ou a processo criminal, que poderão ser fornecidas por meios eletrônicos;
(e) apresentação de documento comprobatório de ocupação lícita e de residência certa (Água, Luz, Telefone, DECLARAÇÃO com firma reconhecida do titular da conta ou do proprietário do imóvel, Certidão de Casamento ou de Comunhão Estável);
(f) comprovação de capacidade técnica e de aptidão psicológica para o manuseio de arma de fogo, realizado em prazo não superior a 01 ano, que deverá ser atestado por instrutor de armamento e tiro e psicólogo credenciado pela Polícia Federal;
(g) declaração do proprietário da arma de fogo que demonstre a intenção de transferir a arma, com firma reconhecida;
ATENÇÃO: A venda/doação e a consequente entrega da arma de fogo somente deve ser realizada após a autorização de transferência concedida pela Polícia Federal, tendo em vista a possibilidade de indeferimento do pedido por não atendimento aos requisitos legais ou regulamentares. A transferência antecipada da arma sem autorização pode caracterizar o crime do porte ilegal de arma.
(h) comprovante bancário de pagamento da taxa devida para a emissão do documento através da Guia de Recolhimento da União - GRU.
(i) 1 (uma) foto 3x4 recente.
IMPORTANTE: O interessado em adquirir arma de fogo deve solicitar a autorização de transferência ANTES de receber a arma do proprietário. Assim, a autorização da Polícia Federal deve ser PRÉVIA, haja vista os requisitos legais que devem ser aferidos antes que haja a transferência de fato do armamento. O procedimento realizado em desacordo com o descrito neste item pode sujeitar o infrator a responder pelo delito previsto no art. 14 da Lei 10.826/03.

- Após a entrada do imigrante no Brasil, caso ele possua um visto, ou queira pleitear o registro com base em acordos deverá comparecer na Polícia Federal;
- O requerente deve preencher o formulário no site da PF, ESTRANGEIRO, <https://servicos.dpf.gov.br/sincreWeb/>;
- Com o formulário preenchido e impresso, deverá realizar agendamento no posto de atendimento desejado e mais perto de sua circunscrição;
- No dia de seu agendamento deve comparecer no posto da PF com os documentos necessários (descritos no site de acordo com o tipo de solicitação); comprovante de pagamento de taxas e formulário impresso;
 - Após o atendimento é entregue ao requerente um PROTOCOLO contendo suas informações pessoais e um prazo de 180 dias que serve para comprovação de sua estada legal no Brasil até o recebimento da carteira.
- O processo é encaminhado via SEI e via SINCRE (SISTEMA DE CADASTRO E REGISTRO DE ESTRANGEIROS) para a PF para emissão de carteira.
- Depois de emitida a carteira é enviada para as unidades locais.
- As carteiras são recebidas pelas unidades locais e entregues para o requerente.

Naturalização é o ato pelo qual uma pessoa adquire voluntariamente uma nacionalidade diferente da sua de origem. 
- Naturalização ordinária - para quem tem permanência, mora no Brasil há quatro anos, saber ler e escrever português e não tenha condenação superior a um ano;
- Naturalização extraordinária - para quem mora no Brasil há quinze anos e não tem condenação penal;
- Naturalização provisória, para estrangeiro admitido no Brasil durante os primeiros cinco anos de vida, estabelecido definitivamente no território nacional;
- Transformação de naturalização provisória em definitiva, solicitada até dois anos após o atingimento da maioridade.
O requerente deve preencher o formulário no site da PF, ESTRANGEIRO, <http://www.pf.gov.br/servicos-pf/estrangeiro/naturalizacao/naturalizacao/>;
Com o formulário preenchido e impresso, deverá realizar agendamento no posto de atendimento desejado e mais perto de sua circunscrição;
No dia de seu agendamento deve comparecer no posto da PF com os documentos necessários (descritos no site de acordo com o tipo de solicitação); comprovante de pagamento de taxas e formulário impresso;
O processo é encaminhado via SEI e via ao Ministério da Justiça para análise.
Será entregue ao interessado recibo contendo prazo previsto para a decisão, as formas de acompanhamento do processo e de notificação de atos;
As decisões de naturalização são publicadas no Diário Oficial da União;
Após a publicação da Portaria de concessão da naturalização será expedido certificado de naturalização que será entregue ao interessado da seguinte forma:
-Nos casos de Naturalização Ordinária, Extraordinária e Transformação de Naturalização Provisória em Definitiva - Pelo juiz federal da residência do interessado em audiência a ser designada;
-Nos casos de Naturalização Provisória - Pelo Polícia Federal;
-Nos casos de Naturalização Especial - Pela Embaixada do Brasil no exterior.

A Declaração de acidente de trânsito eletrônica (e-DAT) é um instrumento oficial para registro pela internet de ocorrências de acidentes em rodovia federal

Para que a e-DAT seja registrada, o acidente deve preencher alguns requisitos:

Somente será permitido o registro de acidentes de natureza simples (aquele com pequenos danos nos veículos, como, por exemplo, leves avarias nas partes externas), que, em geral, estão relacionadas a acidentes de pequena monta;
Não pode ter vitimado ninguém, nem mesmo levemente;

Não pode ter provocado vazamento de produto perigoso;
Não pode ter provocado dano ao meio ambiente ou ao patrimônio público;
Não pode envolver veículo oficial;
Acesse



Não pode envolver mais de cinco veículos;
Não pode ter correlação com crime de trânsito (alcoolemia, por exemplo)
Não pode ter provocado interrupções de pista;
A e-DAT tem que ser feita por pessoa com mais de 18 (dezoito) anos, ou civilmente emancipada, e que possua endereço de e-mail;



Ressalte-se que o registro eletrônico é uma opção, com objetivo de auxiliar aqueles que trafegam pelas rodovias federais, dando agilidade na resolução dos acidentes. Com a e-DAT, a PRF oferece à sociedade uma alternativa de registrar o acidente de trânsito com rapidez, segurança e conforto.

Oferecemos fotos oficiais dos destinos turísticos e de experiências turísticas do Brasil;
As demandas de fotos são feitas através do e-mail: promotional@embratur.gov.br; 
Orientamos o usuário a escolher as fotos no nosso Flickr: https://www.flickr.com/photos/visitbrasil/albums   
Então, enviamos o link com as imagens em alta resolução, juntamente com o Termo de Uso das imagens que foram escolhidas;
