O Programa de Apoio à Tradução e à Publicação de Autores Brasileiros consiste em editais voltados para editoras, instituições e tradutores estrangeiros com o objetivo de promover livros e autores brasileiros no exterior. O Programa é organizado em diferentes modalidades:

1/ Edital de  Apoio à Tradução e à Publicação de Autores Brasileiros no Exterior, oferecido a editoras estrangeiras que desejam publicar títulos brasileiros;
2/Edital de Intercâmbio de Autores Brasileiros no Exterior,  oferecido a editoras e instituições culturais estrangeiras que desejam convidar escritores brasileiros para participar de eventos literários no exterior;
3/ Edital de Residência de Tradutores Estrangeiros no Brasil oferecido a tradutores que queiram permanecer um período no Brasil pesquisando e trabalhando em seu projeto de tradução.

Realizar diagnóstico laboratorial de casos de:
-  Paralisia Flácida Aguda (PFA) - exame de isolamento viral em amostras de fezes para Pesquisa de Poliovírus;
- Meningites Virais - exame de isolamento viral para a Pesquisa de Enterovírus;
-Outras Enteroviroses (conjuntivite hemorrágica, doença exantemática, miocardite, doença de pé, mão e boca) - exames de isolamento viral e identificação molecular (Reação em cadeia da Polimerase -PCR) para a Pesquisa de Enterovírus;
- Outras viroses neurotrópicas (Citomegalovírus e Herpesvírus) - exame de identificação molecular (Reação em cadeia da Polimerase -PCR) para a Pesquisa de Citomegalovírus e Herpesvírus

O  serviço tem como objetivo avaliar e estabelecer ações para assegurar a qualidade sanitária dos animais, garantindo a confiabilidade e reprodutibilidade dos resultados das pesquisas.

Usuários: Instituições de Saúde / Instituições de pesquisa e ensino;
Produto: Laudo com detecção ou não de agentes patogênicos como parasitos, vírus e bactérias do monitoramento sanitário para camundongos, ratos, coelhos, cobaias e hamsters.

Melhorias Sanitárias Domiciliares são intervenções promovidas nos domicílios, com o objetivo de atender às necessidades básicas de saneamento das famílias, por meio de instalações hidrossanitárias mínimas, relacionadas ao uso da água, à higiene e ao destino adequado dos esgotos domiciliares. O Programa de MSD tem os seguintes objetivos:
•	Implantar soluções individuais e coletivas de pequeno porte, com tecnologias apropriadas;
•	Contribuir para a redução dos índices de morbimortalidade provocados pela falta ou inadequação das condições de saneamento domiciliar;
•	Dotar os domicílios de melhorias sanitárias, necessárias à proteção das famílias e à promoção de hábitos higiênicos; e
•	Fomentar a implantação de oficina municipal de saneamento.
O conceito de melhorias sanitárias, neste programa de repasse de recursos não onerosos, está relacionado ao saneamento individual do domicílio, tais como:
•	Ligação de água encanada;
•	Perfuração de poços rasos;
•	Sistema de armazenamento e captação de água da chuva;
•	Construção de banheiros, pias, tanques, cisternas, lixeiras;
•	Ligação de esgoto entre domicílios;
•	Dentre outros.
O Repasse de recursos é realizado para municípios visando a implantação de melhorias sanitárias e saneamento individual em residências e objetiva reduzir o índice de doenças relacionadas à falta de saneamento.
As propostas dos municípios são selecionadas por meio de processos seletivos publicados anualmente em Portarias no Diário Oficial da União, que divulgam também os critérios de seleção e as ações a serem contempladas. Outra possibilidade de apoiar os proponentes é por meio de Emendas Parlamentares, sendo necessário respeitar as exigências contidas na Portaria vigente que dispõe sobre as normas relativas às tranferências de recursos, bem como nos manuais orientativos da Funasa, para Elaboração de Propostas, disponíveis no endereço: www.funasa.gov.br.

