O Registro de Museus – RM é um instrumento previsto pelo Estatuto de Museus (Lei nº 11.904/2009) que objetiva estimular a formalização dos museus, a partir do acompanhamento das dinâmicas de criação, fusão, incorporação, cisão ou extinção de museus, visando criar mecanismos de coleta, análise e compartilhamento de informações sobre os museus brasileiros, com o propósito de aprimorar a qualidade de suas gestões e fortalecer as políticas públicas setoriais.
O RM caracteriza-se por:
- Possibilitar um processo federativo integrado;
- Possuir metodologia unificada de coleta de dados;
- Permitir interface com os sistemas nacionais e internacionais de investigação do campo cultural: SNIIC, Registro dos Museus Ibero-Americanos, Contas da Cultura (IBGE/MinC);
- Prover agilidade na adesão ao Sistema Brasileiro de Museus.

v_Q002:
Autorização para o Licenciamento Ambiental - ALA;
Autorização Direta - AD;
Autorização ou Anuência para Supressão de Vegetação - ASV;
Autorização para Coleta, Captura e Transporte de Material Biológico - ABio.

v_Q003:
ALA - Autorização para o Licenciamento Ambiental - Ato administrativo pelo qual o Instituto Chico Mendes Autoriza o órgão ambiental competente a a proceder ao licenciamento ambiental de empreendimentos e atividades que afetem as unidades de conservação federais ou suas zonas de amotecimento;
AD - Autorização Direta - ato administrativo que autoriza atividades ou empreendimentos com potencial ou efetivo impacto para as unidades de conservação federais, dispensados ou não sujeitos ao licenciamento ambiental, ou cuja autorização seja exigida por normas específicas de cada unidade de conservação;
ASV - Anuência para Autorização para Supressão de Vegetação: documento em que o Instituto Chico Mendes manifesta sua concordância ao órgão licenciador em casos de solicitação para supressão de vegetação realizadas no interior de unidades de conservação federais.
ASV - Autorização para Supressão de Vegetação: documento em que o Instituto Chico Mendes autoriza o interessado pela atividade a proceder a supressão de vegetação no interior de unidades de conservação federais para as atividades não sujeitas ao licenciamento ambiental. 
ABio - Autorização para Captura, Coleta de Material Biológico - documento em que o Instituto Chico Mendes manifesta sua concordância ao órgão licenciador a que o interessado proceda a com a coleta de material biológico, a captura ou marcação de animais silvestres in situ e o transporte de material biológico para a realização de estudos ambientais dos processos de licenciamento ambiental federal.

