v_Q003:
As empresas interessadas em se tornar Oficina de Selagem deverão formalizar o pedido de cadastramento junto à Coordenação do Programa de Cronotacógrafos, instruídos com os seguintes documentos de informações:

I – Solicitação de cadastramento como Oficina de Selagem;
II – Termo de responsabilidade e de compromisso;
III – Declaração com a identificação dos veículos da frota que possuem cronotacógrafos e os respectivos locais de operação;
IV – Declaração de competência técnica constando dos seguintes documentos:

a)	Certificados de calibração emitidos por laboratórios acreditados conforme requisitos da ABNT NBR ISO/IEC 17025:2005 dos geradores de pulsos, geradores de rotações, coletores de pulsos, coletores de rotações, trenas lineares (faixa mínima de 20 metros);
b)	Comprovante de qualificação dos técnicos emitido por fabricante de cronotacógrafo, ou por empresa autorizada por este;
c)	Certificado de aprovação em capacitação ministrada pelo Inmetro ou por órgão pertencente à RBMLQ-I para selagem de cronotacógrafos;
d)	Comprovante de vínculo empregatício dos técnicos com a empresa;

V – Certidão simplificada da Junta Comercial, indicando os representantes legais da empresa e o objeto social;
VI – Acesso em banda larga à rede mundial de computadores (Serviço de Comunicação Multimídia);
VII – O interessado deverá satisfazer tecnicamente os requisitos abaixo, a serem evidenciados por meio da documentação e de avaliação a ser executada pelo Inmetro:

a)	Possuir pista auxiliar horizontal e plana, em área coberta, livre de obstáculos, com proteções laterais para evitar incidência de chuva com vento, construída em concreto polido resistente às cargas de circulação de veículos pesados, com comprimento mínimo de 20 m (vinte metros), largura mínima de 4 m (quatro metros) e altura de 4,5 (quatro metro e meio);
b)	Disposito “auxiliar” para acesso a parte inferior do veículo para realização da selagem (por exemplo, carrinho para mecânico)
c)	Ferramental adequado para a execução das atividades relacionadas à selagem.

As empresas interessadas em se tornar Posto de Selagem deverão formalizar o pedido de cadastramento junto à Coordenação do Programa de Cronotacógrafos, instruídos com os seguintes documentos de informações:

I – Solicitação de cadastramento como Posto de Selagem;
II - Certidão simplificada da Junta Comercial, indicando os representantes legais da empresa e o objeto social;
III – Termo de responsabilidade, de compromisso e isenção de conflito de interesses;
IV – Declaração de competência técnica constando dos seguintes documentos:

a)	Certificados de calibração emitidos por laboratórios acreditados conforme requisitos da ABNT NBR ISO/IEC 17025:2005 dos geradores de pulsos, geradores de rotações, coletores de pulsos, coletores de rotações, trenas lineares (faixa mínima de 20 metros);
b)	Comprovante de qualificação dos técnicos emitido por fabricante de cronotacógrafo, ou por empresa autorizada por este;
c)	Certificado de aprovação em capacitação ministrada pelo Inmetro ou por órgão pertencente à RBMLQ-I para selagem de cronotacógrafos;
d)	Comprovante de vínculo empregatício dos técnicos com a empresa;

V – Acesso em banda larga à rede mundial de computadores (Serviço de Comunicação Multimídia);
VI – O interessado deverá satisfazer tecnicamente os requisitos abaixo, a serem evidenciados por meio da documentação e de avaliação a ser executada pelo órgão metrológico delegado do Inmetro no Estado da solicitante:

a)	Possuir pista auxiliar horizontal e plana, em área coberta, livre de obstáculos, com proteções laterais para evitar incidência de chuva com vento, construída em concreto polido resistente às cargas de circulação de veículos pesados, com comprimento mínimo de 20 m (vinte metros), largura mínima de 4 m (quatro metros) e altura de 4,5 (quatro metro e meio);
b)	Disposito “auxiliar” para acesso a parte inferior do veículo para realização da selagem (por exemplo, carrinho para mecânico)
c)	Ferramental adequado para a execução das atividades relacionadas à selagem.

As associações da sociedade civil, o Ministro de Estado da Cultura, as instituições vinculadas ao Ministério da Cultura, as secretarias estaduais, municipais e do Distrito Federal são competentes para requerer a instauração do processo de reconhecimento de bens de natureza imaterial, por meio do Registro, conforme disposto no Decreto nº 3.551/2000 (http://www.planalto.gov.br/ccivil_03/decreto/D3551.htm) e na Resolução nº 01/2006 http://portal.iphan.gov.br/portal/baixaFcdAnexo.do?id=1383).
Requisitos para o acesso
Requerimento dirigido ao Presidente do IPHAN ou às Superintendências em cada estado da Federação.
O requerimento deve ser apresentado em formato original, datado e assinado, acompanhado dos seguintes documentos e informações:
> Identificação do proponente (nome, endereço, telefone, e-mail etc.);
> Justificativa do pedido;
> Denominação e descrição sumária do bem, com indicação da participação e/ou atuação dos grupos sociais envolvidos, de onde ocorre ou se situa, do período e da forma em que ocorre;
> Informações históricas básicas sobre o bem;
> Documentação mínima disponível, adequada à natureza do bem, como fotografias, desenhos, vídeos, gravações sonoras ou filmes;
> Referências documentais e bibliográficas disponíveis;
> Declaração formal de representante da comunidade produtora do bem ou de seus membros,
expressando o interesse e a anuência à instauração do processo de Registro.
Como acessar o serviço
Por ofício: Dirigido prioritariamente à Superintendência do IPHAN no estado onde o bem se localiza, ou à Presidência do IPHAN.
Tempo para a prestação do serviço: Até trinta dias, para informar a abertura de processo administrativo.
Até três anos, para informar o deferimento ou indeferimento do Registro.

O cidadão interessado em retirar obra de arte do país para fins de mudança domiciliar, exposição, doação ou comércio, deverá pedir autorização ao IPHAN, a fim de que se verifique se o bem integra o patrimônio cultural brasileiro, conforme Decreto-Lei nº 25/1937 (http://www.planalto.gov.br/ccivil_03/decreto-lei/del0025.htm), Lei nº 3.924/1961 (http://www.planalto.gov.br/ccivil_03/leis/1950-1969/L3924.htm), Lei nº 4.845/1965 (http://www.planalto.gov.br/ccivil_03/leis/L4845.htm) e Lei nº5.471/1968 (http://www.planalto.gov.br/ccivil_03/leis/L5471.htm).
Requisitos para o acesso
> Formulário para solicitação de autorização para saída de obras de arte do país preenchido;
> Cópia do RG e CPF do solicitante (proprietário ou seu procurador);
> Cópia da procuração (quando for o caso);
> Dados técnicos do objeto: tipo do objeto, título (se for o caso), datação, autoria, materiais, dimensões, técnicas de confecção e fotografias coloridas (mínimo de dois ângulos).
Como acessar o serviço
Por ofício: Dirigido à Superintendência do IPHAN em seu estado.
Tempo para a prestação do serviço: Até quinze dias úteis.

O cidadão ou instituição interessado(a) retirar do país um bem cultural protegido, para participar de exposição internacional, ou de outra forma de intercâmbio cultural, deverá pedir autorização ao IPHAN, conforme Decreto-Lei nº 25/1937 (http://www.planalto.gov.br/ccivil_03/decreto-lei/del0025.
htm), Lei nº 3.924/1961 (http://www.planalto.gov.br/ccivil_03/leis/1950-1969/L3924.htm), Lei nº4.845/1965 (http://www.planalto.gov.br/ccivil_03/leis/L4845.htm) e Lei nº 5.471/1968 (http://www.planalto.gov.br/ccivil_03/leis/l5471.htm).
Requisitos para o acesso
Solicitação formal do proprietário, ou seu representante legal, a ser apresentada com a antecedência
de noventa dias à data fixada para a saída do bem, contendo:
> Dados técnicos completos do bem: tipo, autoria, título, datação, materiais, técnicas de confecção, dimensões, marcas, inscrições, estado de conservação, três fotos (9 cm x 12 cm), coloridas, no caso de obra policromada;
> Identificação dos promotores da exposição;
> Indicação do roteiro dos bens, com especificação de instituições, cidades, países onde serão expostos;
> Cópia das solicitações das instituições estrangeiras interessadas em expor os bens;
> Período da exposição e data provável do retorno ao país;
> Avaliação dos bens para efeito de seguro;
> Indicação dos responsáveis pela embalagem;
> Indicação dos responsáveis pelo embarque e desembarque;
> Indicação da empresa transportadora;
> Indicação da empresa seguradora;
> Indicação dos lotes, se for o caso;
> Entrega da cópia da respectiva apólice de seguro, até quinze dias antes da data prevista para a saída do bem.
Como acessar o serviço
Por ofício: Dirigido à Superintendência do IPHAN em seu estado.
Tempo para a prestação do serviço: Até noventa dias

O IPHAN possui o Mestrado Profissional em Preservação do Patrimônio Cultural, reconhecido pelo Ministério da Educação, por meio da Portaria MEC nº 978/2012. É um curso interdisciplinar, cuja área de concentração é Preservação do Patrimônio Cultural, contando com duas linhas de pesquisa
– Patrimônio Cultural: história, política e sociedade e Patrimônio Cultural: instrumentos, informação e desenvolvimento.
O IPHAN seleciona anualmente vinte alunos, por meio de edital público, para o Mestrado Profissional em Preservação do Patrimônio Cultural (PEP-MP). Os alunos recebem bolsas de estudos oferecidas pelo IPHAN, seguindo padrões da Coordenação de Aperfeiçoamento de Pessoal de Nível Superior, do
Ministério da Educação – CAPES/MEC.
Requisitos para o acesso
> Ser cidadão brasileiro com graduação em curso superior reconhecido pelo MEC;
> Ter formação na área definida pelo Edital;
> Preencher e assinar o formulário de inscrição.
Enviar o formulário preenchido e assinado, por Sedex ou Carta Registrada com Aviso de Recebimento, ou entregar em mãos exclusivamente para a Coordenação do Mestrado, na cidade do Rio de Janeiro, anexando ainda cópia dos seguintes documentos:
> Registro de identidade;
> Cadastro de Pessoa Física (CPF);
> Certidão de quitação com a Justiça Eleitoral;
> Documento de quitação com as obrigações militares, para candidatos do sexo masculino;
> Diploma do curso superior reconhecido pelo MEC, na graduação exigida no edital;
> Curriculum vitae cadastrado na Plataforma Lattes (http://lattes.cnpq.br/), impresso em sua versão completa;
> Carta assinada de exposição de motivos, com no mínimo uma lauda (tamanho A4) e no máximo duas, em fonte Times New Roman, tamanho 12, espaço entre linhas 1,5, margens de 2 cm em toda a volta, contendo, obrigatoriamente, os seguintes itens: a) justificativa para a candidatura ao Mestrado;
b) os objetivos a serem perseguidos; e c) interesse em desenvolver as atividades propostas pelo Programa;
> Ensaio crítico ou outro exercício solicitado, assinado, abordando o conteúdo de textos escolhidos
entre os descritos no edital.
Como acessar o serviço
Mediante participação em processo seletivo anual regido por Edital Público divulgado em www.iphan.gov.br
Presencial: Informações na Coordenação do Mestrado. Sede do Mestrado: Palácio Gustavo Capanema - Rua da Imprensa, nº 16, 8º andar, sala 808, Centro, Rio de Janeiro-RJ, CEP: 20.030-120.
Telefones: (21) 2215-5263/5155.
Virtual: http://portal.iphan.gov.br | Por e-mail: mestrado.pep@iphan.gov.br
Tempo para prestação do serviço: 
O Mestrado tem duração de 24 meses.

