Financiamentos a pessoas jurídicas destinados à implantação, ampliação e/ou modernização de empreendimentos, objetivando a realização de investimentos na área de atuação da Sudene em infraestrutura e serviços públicos e em empreendimentos produtivos com grande capacidade germinativa de novos negócios e novas atividades produtivas.
A concessão do benefício compreende as seguintes etapas ou processos:
1) A empresa proponente deverá apresentar a Consulta-Prévia à Sudene;
2) Em caso de aprovação, a Sudene emitirá o  Termo de Enquadramento da Consulta-Prévia ao interessado, que negociará o projeto com o Agente Operador de sua preferência, que autorizará a elaboração do projeto e comunicará à Superintendência;
3) Com a autorização, o empreendedor deverá apresentar o projeto definitivo diretamente ao Agente Operador escolhido;
4) O Agente Operador irá realizar a análise técnico-econômico-financeira e de risco do projeto. Caso o Agente Operador aprove o projeto, este será submetido à manifestação da Diretoria Colegiada da SUDENE, que decidirá quanto à participação do FDNE;
5) Após a aprovação do projeto pela Sudene, a empresa interessada deverá apresentar ao Agente Operador as informações e os documentos necessários à celebração do contrato de financiamento.
